Boa noite galera, The Last of Us 2: Ellie não usará as "faquinhas" caseiras do primeiro jogo.📸🎮😀
-
_
(Notícias)🗞⤵️
_

Novas informações de The Last of Us 2 estão sendo compartilhadas aos poucos. Alguns detalhes da jogabilidade foram revelados pelo co-diretor, Anthony Newman, em entrevista ao VG247. O produtor revelou que as facas caseiras (shivs) do primeiro jogo, feitas com “sucata”, não vão retornar.
.
Newman explicou que Ellie vai estar acompanhada do seu canivete o tempo todo e, por isso, não há razão de disponibilizar as facas caseiras no mundo. Contudo, a Naughty Dog trabalhou para equilibrar a dificuldade mesmo com a arma disponível o tempo todo.
_
Para nós, o canivete da Ellie é uma marca registrada. Então nós fomos desafiados em como fazer a jogabilidade furtiva contra os Clickers continuar a ser trabalhosa mesmo com o canivete.
_
.
O co-diretor disse que a arma especial da protagonista permite que os inimigos sejam abatidos, porém, as mecânicas de jogabilidade foram alteradas. Em The Last of Us 2, Ellie vai precisar se movimentar de forma muito mais lenta para que não seja detectada pelos Estaladores.
.
Newman afirmou que a intenção da Naughty Dog é garantir que os jogadores “tenham sempre algo novo para experimentar”. Assim como a história, o combate do game promete ser ainda mais envolvente que o primeiro jogo.
